INSERT INTO public.pets VALUES (4, 'Toby', 'Es un tipo cariñoso y no hay nada que le guste más que pasar tiempo con sus personas favoritas y recibir mucha atención.||A Toby le gustan los paseos y le encanta conocer y saludar a otros perros cuando pasa, pero también le encanta acurrucarse en el sofá por la noche. A Toby también le encanta jugar, pero puede ser un poco entusiasta, por lo que puede ser más adecuado para una casa con niños en edad escolar.||Es un chico muy tranquilo y seguro que será un compañero fantástico. Si Toby parece ser el chico ideal para ti, envía tu solicitud hoy mismo. Ten en cuenta que Toby es un bulldog francés grande, ya que pesa 16,9 kg.||“Los perros de cara plana (braquicéfalos) sufren problemas de salud adicionales que pueden afectar su calidad de vida. Siempre recomendamos a quienes estén pensando en adoptar o comprar un perro de cara plana (braquicéfalo) que investiguen a fondo la raza de antemano. Nuestro equipo de expertos podrá darle consejos sobre ejercicio y control de peso, así como sobre cualquier ayuda que Frank pueda necesitar”.', '2022-08-13 00:00:00', 24.00, 24.00, 'male', 'gris blanco', '{Alerta,Juguetón}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733625022/123e4567-e89b-12d3-a456-426614174014/zrdberh4gpxkzkqngdaf.png", "fileName": "Toby-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/zrdberh4gpxkzkqngdaf"}', 1, 4, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-07 21:32:14.762', '2024-12-07 21:32:14.762');
INSERT INTO public.pets VALUES (1, 'Ebony', 'A Ebony le encanta aprender y ha aprendido rápidamente las nuevas habilidades que le enseñamos. Disfruta tumbada en su colchoneta favorita con un juguete para masticar y jugando con sus juguetes.||Buscamos un hogar con dueños con mentalidad de adiestramiento y experiencia con perros con mucha energía. Ebony ha tenido dificultades para adaptarse a sus hogares anteriores y esto es algo en lo que estamos trabajando aquí en el centro. Lo ideal sería que los nuevos dueños de Ebony estuvieran en casa la mayor parte del día.||Ebony podría vivir con niños adolescentes que comprendan su naturaleza vivaz y podrán ayudar con el entrenamiento.||Ebony deberá ser la única mascota de la casa. Le vendría bien tener algunos amigos perrunos con los que pueda seguir socializando. Perseguirá a los gatos, por lo que no podrá vivir con ellos.||Una vez que Ebony esté en un hogar con una buena rutina y estructura en su vida diaria, ¡creemos que esta hermosa niña brillará!||Si cree que podría tener el hogar perfecto para Ebony, esperamos saber de usted', '2023-11-10 00:00:00', 25.00, 30.00, 'female', 'blanco y negro', '{Amigable,Activa}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733614663/123e4567-e89b-12d3-a456-426614174014/ydj9mq8fuyknq5b6znfv.png", "fileName": "Ebony-photo-1.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/ydj9mq8fuyknq5b6znfv"}', 1, 40, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-07 18:49:56.077', '2024-12-07 18:49:56.077');
INSERT INTO public.pets VALUES (6, 'Jared', 'Estos cachorros son muy inteligentes y necesitarán orientación sobre cómo dirigir su energía. Son un poco inseguros, por lo que necesitarán tiempo para adaptarse a sus nuevos hogares y todo se hará a su propio ritmo.||Necesitarán una nueva familia con tiempo para poder ofrecerles un estilo de vida activo y divertido, ya sea con entrenamiento, enriquecimiento, paseos más largos y enriquecedores y tiempo de juego.||Recomendamos a cualquiera que consulte sus perfiles que investigue ambas razas.||Necesitarán a alguien cerca la mayor parte del día, ya que aún no se sienten cómodos estando solos o no están acostumbrados a hacer sus necesidades en casa.', '2023-10-10 00:00:00', 25.00, 36.00, 'male', 'tricolor', '{Sociable,Juguetón}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733627742/123e4567-e89b-12d3-a456-426614174003/yiwzqiavjp1q6d9gbnda.png", "fileName": "Jared-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174003/yiwzqiavjp1q6d9gbnda"}', 1, 18, '123e4567-e89b-12d3-a456-426614174003', 'Available', '2024-12-07 21:58:16.982', '2024-12-07 21:58:16.982');
INSERT INTO public.pets VALUES (11, 'Evie', 'Evie es una verdadera introvertida que se desarrolla muy bien en su tiempo en casa, y prefiere jugar mucho con su gente en lugar de explorar al aire libre. Cuando está afuera, le gusta estar sola, no tiene tiempo ni energía para conocer al público en general, ¡muchas gracias! Evie se adaptaría mucho mejor a una rutina de paseos cortos en lugar de caminatas largas.||Esta mujer tranquila y digna busca una nueva familia con un ambiente tranquilo y acogedor que pueda satisfacer sus objetivos de cuidado personal. Preferiría vivir con adultos y jóvenes, ya que prefiere un entorno predecible.||A Evie le gustaría que la gente entienda que a veces puede sentirse abrumada cuando hay muchas cosas sucediendo, y pide que le ofrezcan un entorno seguro donde se sienta lo suficientemente segura como para manejar aquellas cosas que pueden ser un poco demasiado para ella.||Construye una relación al ritmo de Evie y ella compartirá contigo un secreto: en realidad es una campeona encubierta del juego de tira y afloja. Y está totalmente obsesionada con jugar con juguetes. De hecho, tendrás que recordarle que baje el ritmo, ya que se concentra demasiado y se vuelve muy tonta.||¡La tímida pero encantadora Evie espera que tu sofá tenga un lugar esperando para poder echarse una siesta!', '2024-01-09 00:00:00', 11.00, 21.00, 'female', 'atigrado blanco', '{Afectuosa,Tranquila,"Un Poco Tímida"}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733757380/123e4567-e89b-12d3-a456-426614174005/mkaeaqwqjcrlr6sltjnf.png", "fileName": "Evie-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174005/mkaeaqwqjcrlr6sltjnf"}', 1, 13, '123e4567-e89b-12d3-a456-426614174005', 'Available', '2024-12-09 10:16:31.715', '2024-12-09 10:16:31.715');
INSERT INTO public.pets VALUES (9, 'Ziggy', 'Este encantador niño está buscando un nuevo hogar y espera encontrar una familia permanente que se tome el tiempo para comprenderlo.||Ziggy, que es un perro socialmente torpe, no tiene muchas ganas de conocer a sus amigos perrunos cuando está fuera de casa. Prefiere estar solo. ¡Disfruta mucho de la vida tranquila! Por eso también preferiría un hogar sin niños pequeños, ya que los considera demasiado. Pero se llevaría bien con niños mayores que podrían ser muy respetuosos y comprensivos con la personalidad única de Ziggy y su necesidad de espacio.||A Ziggy le encanta tomar el sol cuando el clima es propicio y le encanta comer algo de carne de vez en cuando. Cuando ha entablado una relación con una persona, es un perro muy cariñoso que disfruta de correr por el jardín. Promete proteger la casa de los ositos de peluche y los juguetes blandos, siempre y cuando no te importe recoger el relleno.||La nueva familia ideal de Ziggy debería estar formada por personas amables y pacientes que sean sus fans número uno y lo ayuden a superar todas las cosas que le resultan difíciles.||Si crees que eres la persona adecuada para Ziggy, ¡presenta tu solicitud!', '2022-02-24 00:00:00', 13.00, 21.00, 'male', 'canela', '{Afectuoso,Tranquilo,Protector}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733755771/123e4567-e89b-12d3-a456-426614174004/v24y4u32alxisrxzybzz.png", "fileName": "Ziggy-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174004/v24y4u32alxisrxzybzz"}', 1, 14, '123e4567-e89b-12d3-a456-426614174004', 'Available', '2024-12-09 09:51:45.798', '2024-12-09 09:51:45.798');
INSERT INTO public.pets VALUES (2, 'Creed', 'Creed es un hermoso Staffordshire Bull Terrier de 5 años con una energía desbordante y un corazón lleno de amor. Si buscas un compañero que te mantenga alerta, Creed puede ser la opción perfecta.||Creed está lleno de vida y siempre está listo para una aventura. Ya sea una caminata larga, un divertido juego de buscar la pelota o simplemente correr por el jardín, le encanta estar activo y comprometido. Tiene mucha energía para gastar y le iría bien en un hogar que le brinde mucho ejercicio y estimulación mental. Para sus paseos, Creed necesitaría estar atado con correa.||La familia actual de Creed comenta que sus cosas favoritas en el mundo son jugar al tira y afloja o jugar con sus juguetes de pelota.||Definitivamente también tiene un lado cariñoso y le encanta pasar tiempo con sus personas favoritas. Le encanta estar cerca de la gente para mimarlo y relajarse.||Creed no sería adecuado para vivir con gatos u otros perros. Sería más adecuado para hogares con niños mayores en edad de asistir a la escuela secundaria.', '2020-01-14 00:00:00', 26.00, 33.00, 'male', 'atigrado blanco', '{Dulce,Leal}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733620530/123e4567-e89b-12d3-a456-426614174014/l5b9hypxopba7gs2vbmq.png", "fileName": "Creed-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/l5b9hypxopba7gs2vbmq"}', 1, 40, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-07 20:18:24.666', '2024-12-07 20:18:24.666');
INSERT INTO public.pets VALUES (3, 'Willow', 'Los Willows suelen ser conocidos por su gracia, encanto y resistencia. Todo esto es cierto en el caso de nuestra preciosa Willow, que está siendo reubicada debido a un cambio en las circunstancias personales de su dueña. Cuando no está durmiendo la siesta o jugando con sus juguetes, a Willow le encanta salir a caminar. De hecho, sabe lo que significa la palabra ""W"" y corre por todos lados con entusiasmo antes de esperar junto a la puerta principal para salir.||Willow es una compañera adorable para su dueña y disfruta acurrucándose en el sofá por las noches. Willow puede tardar un tiempo en entablar una relación con nuevas personas, ya que no está acostumbrada a encontrarse con extraños a menudo. Está buscando un nuevo hogar familiar que le brinde el tiempo y la paciencia que necesita para adaptarse y ganar confianza. Debido a esto, Willow necesitaría conocer a sus adoptantes en varias ocasiones en el centro antes de volver a casa.||Willow no ha vivido con niños pequeños antes; por lo tanto, estaríamos buscando un hogar familiar con niños en edad de escuela secundaria o mayores.', '2022-07-28 00:00:00', 31.00, 52.00, 'female', 'plateado', '{Afectuosa,Tranquila}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733621417/123e4567-e89b-12d3-a456-426614174014/zzmsm9o5e1wejxknwolk.png", "fileName": "Willow-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/zzmsm9o5e1wejxknwolk"}', 1, 1, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-07 20:31:57.936', '2024-12-07 20:31:57.936');
INSERT INTO public.pets VALUES (8, 'Nala', 'Nala es una perrita divertida, vivaz, amigable y con mucho potencial. Es sociable con la gente y disfruta de que la mimen y saluden. Aunque es una perrita grande, a veces se cree una perrita faldera y le encanta acurrucarse en el sofá para que la acaricien.||Nala es activa y disfruta de sus paseos. Es sociable con los perros que conoce en la calle, pero puede ser demasiado vivaz para algunos, por lo que actualmente la pasean con correa. Podría vivir con otro perro, pero tendrían que ser perros maduros, de tamaño mediano o grande, robustos y tolerantes con su comportamiento inquieto. Todavía es joven y no sabe cuándo es suficiente cuando se trata de jugar con otros perros, por lo que los nuevos dueños tendrán que guiarla en esta área.||A Nala le encanta aprender y disfruta de entrenar e interactuar con su adiestrador. Sabe mucho para su edad y le encantaría aprender más. Cuando juega, le gusta buscar y todavía está aprendiendo a traer el juguete, pero tiene muy buenos modales y es receptiva. Es una perrita grande y, a veces, puede ser fuerte con la correa, por lo que necesita dueños físicamente activos y en forma.||Nala será una compañera increíble en el hogar adecuado, pero necesita dueños que estén cerca todo el día, ya que actualmente no puede quedarse sola. A veces puede ponerse un poco nerviosa y necesitará más entrenamiento para mantener las cuatro patas en el suelo cuando está nerviosa. Busca un hogar sin gatos, pero podría vivir con adolescentes.
INSERT INTO public.pets VALUES (12, 'Bibi', 'La adorable Bibi está buscando nuevos dueños que amen el ejercicio tanto como ella. Puede ser un poco reservada cuando conoce gente nueva, pero con un poco de tiempo pronto se anima y pide algo de atención.||A ella le encanta la atención en forma de juego, mimos, siestas y paseos, así que si estás buscando una compañera divertida para tener a tu lado y explorar el mundo, Bibi es la chica para ti.||Bibi se lleva bien con otros perros y potencialmente podría vivir con un perro compatible a la espera de las presentaciones en el centro, sin embargo, las mascotas pequeñas y los gatos no podrían vivir con ella ya que tiene un instinto de presa.||Bibi puede mostrarse un poco reacia a conocer gente nueva, por lo que estaría más feliz viviendo con niños mayores que hayan tenido experiencia con perros en el pasado.||¡Si crees que Bibi sería una buena opción, completa una solicitud hoy mismo!', '2021-05-17 00:00:00', 31.00, 45.00, 'female', 'Marrón Blanco', '{Juguetona,Exploradora}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733757898/123e4567-e89b-12d3-a456-426614174013/t0ca7fg8zwaujw3xzhve.png", "fileName": "Bibi-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174013/t0ca7fg8zwaujw3xzhve"}', 1, 42, '123e4567-e89b-12d3-a456-426614174013', 'Available', '2024-12-09 10:26:24.918', '2024-12-09 10:26:24.918');
INSERT INTO public.pets VALUES (7, 'Storms', 'Esta encantadora dama está buscando un nuevo hogar donde plantar sus patas.||Storms es una chica dulce a la que nada le gusta más que estar con sus seres queridos. Se la describe como "tan cariñosa que cree que es un perro faldero", por lo que busca dueños que estén en casa la mayor parte del día.Su día ideal sería dar un agradable paseo entre las hojas otoñales, antes de volver a casa y acurrucarse junto al fuego antes de dirigirse a establecimientos que admitan perros.||Storms tiene antecedentes de paseos sin correa y podría volver a hacerlo una vez que se haya adaptado a su nuevo hogar y haya desarrollado el recuerdo.||A Storms le gusta el juego cooperativo, y esta sería una excelente manera para que quienes la adopten puedan construir una relación con ella.||Storms puede ser un compañero canino durante los paseos y podría vivir con un compañero canino adecuado a la espera de los encuentros en el centro. Podría vivir con niños mayores que puedan apreciar su necesidad de espacio.||Si esta encantadora chica suena como la compañera canina para usted, presente su solicitud hoy mismo.||“Debido a su tamaño, Storms necesitará que alguien físicamente capaz de manejarla la saque a pasear. Las razas de bulldog grandes no suelen ser adecuadas para dueños primerizos o inexpertos, y siempre recomendamos a cualquier persona que esté pensando en adoptar o comprar un bulldog grande que investigue a fondo los antecedentes del perro de antemano”.', '2013-05-16 00:00:00', 29.00, 49.00, 'female', 'blanco', '{Juguetona,Inteligente}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733754406/123e4567-e89b-12d3-a456-426614174003/ske7kqfitbzeqsomvzsh.png", "fileName": "Storms-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174003/ske7kqfitbzeqsomvzsh"}', 1, 11, '123e4567-e89b-12d3-a456-426614174003', 'Available', '2024-12-09 09:28:33.812', '2024-12-09 09:28:33.812');
INSERT INTO public.pets VALUES (15, 'Panda', 'Panda está buscando un nuevo hogar, y lo ideal sería que fuera en un entorno rural, ya que disfruta pasar tiempo al aire libre y le gusta explorar y vivir aventuras.||Sería ideal para personas que buscan un gato activo con mucha energía y personas que puedan mantenerla entretenida con juegos de enriquecimiento.||Panda tendría que ser la única mascota en la casa, ya que no ha tenido contacto con otras mascotas anteriormente, por lo que no estaríamos seguros de si le gustaría compartir una casa.||Puede vivir con niños mayores que la respetarán y le ofrecerán espacio mientras se adapta.||El acceso al exterior será imprescindible para Panda.||Si crees que Panda es adecuado para ti, ¡contáctanos hoy mismo!', '2020-05-29 00:00:00', 3.20, 19.00, 'female', 'Blanco y Negro', '{Cariñosa,Exploradora}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733760428/123e4567-e89b-12d3-a456-426614174014/xodusz1ptjxtmixmgctx.png", "fileName": "Panda-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/xodusz1ptjxtmixmgctx"}', 2, 22, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 11:07:40.215', '2024-12-09 11:07:40.215');
INSERT INTO public.pets VALUES (21, 'Tilly', 'Esta preciosa y rara niña pelirroja está buscando su nuevo hogar.||Tilly es una perrita dulce a la que le encanta que la mimen, pero es una perrita independiente a la que le gusta que la mimen en sus propios términos, pero se desarrolla muy bien en compañía de personas conocidas. Puede ser un poco tímida con personas nuevas, por lo que los nuevos dueños deben tener en cuenta que al principio puede requerir un poco de paciencia.||Tilly preferiría ser la única mascota en la casa, pero estaría feliz de vivir con niños mayores en edad escolar que puedan leer su lenguaje corporal y ayudar a participar en su cuidado diario.||A ella le gusta explorar el aire libre, por lo que necesitará acceso al exterior una vez que se haya instalado en su nuevo hogar.||Si cree que Tilly sería una excelente opción para usted, envíe una solicitud hoy mismo.', '2019-02-07 00:00:00', 3.20, 20.00, 'female', 'Pelirroja', '{Cariñosa,Exploradora,Tranquila}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733764376/123e4567-e89b-12d3-a456-426614174014/xcuob8mys5yhivlhmb10.png", "fileName": "Tilly-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/xcuob8mys5yhivlhmb10"}', 2, 22, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 12:13:08.996', '2024-12-09 12:13:08.996');
INSERT INTO public.pets VALUES (16, 'Amber', 'Conoce a Amber, una encantadora señora mayor que desafía su edad con su espíritu juguetón y su personalidad amorosa. Esta encantadora niñita puede ser una profesional experimentada en la vida, pero aún tiene una chispa juvenil que brilla en todo lo que hace. A Amber le encanta la compañía y adora pasar tiempo con sus humanos, ya sea jugando o acurrucándose para una siesta acogedora en el sofá.||Tiene un corazón de oro y seguro que llenará tu hogar de amor y alegría. Sin embargo, esta adorable chica prefiere ser la reina de su castillo, por lo que le irá mejor siendo la única gata de la casa.||Amber busca un hogar cálido y amoroso donde la puedan mimar y cuidar. Si estás listo para darle la bienvenida a esta dulce chica en tu vida, ¡promete recompensarte con ronroneos y afecto sin fin!', '2012-09-16 00:00:00', 4.00, 20.00, 'female', 'pelirroja', '{Afectuosa,Tranquila}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733760980/123e4567-e89b-12d3-a456-426614174014/dswgiaee1lkftrqgjomq.png", "fileName": "Amber-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/dswgiaee1lkftrqgjomq"}', 2, 22, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 11:16:36.469', '2024-12-09 11:16:36.469');
INSERT INTO public.pets VALUES (20, 'Ted', 'Está buscando un nuevo hogar perfecto que pueda llamar suyo.||Ted es un gato muy cariñoso, capaz de cautivar a cualquiera que conozca con su adorable carita. Disfruta de los mimos y la atención, y también de hacer lo que le dé la gana.||Preferiría ser la única mascota en el hogar y le gustaría que todos los niños en el hogar pudieran respetar su espacio.||Le encantaría una casa que le permitiera acceder al exterior. Promete recibirte en la puerta cuando llegues a casa y verte sano y salvo en el interior. ¡Qué caballero!||Si crees que Ted es el gato adecuado para unirse a tu familia, ¡no dudes en postularte!', '2018-09-16 00:00:00', 3.50, 19.00, 'male', 'Atigrado', '{Cariñoso,Inteligente,Juguetón}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733763980/123e4567-e89b-12d3-a456-426614174014/npjjzxrseunul4skvasj.png", "fileName": "Ted-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/npjjzxrseunul4skvasj"}', 2, 22, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 12:06:34.017', '2024-12-09 12:06:34.017');
INSERT INTO public.pets VALUES (10, 'Murphy', 'Murphy es un niño encantador que disfruta de pasar tiempo de calidad con sus seres queridos. Le encanta pasar tiempo al aire libre explorando y viendo pasar el mundo, pero como es un chico mayor, tiene algo de artritis que limita la distancia que puede caminar. Unos paseos cortos, en algún lugar tranquilo y agradable, serían perfectos para él. Está tomando analgésicos para esto, y le va bien, así que es algo que deberá seguir haciendo en su nuevo hogar.||Lo que más le gusta es conocer gente y recibir toda la atención que se merece, por eso le encantaría tener a alguien en casa la mayor parte del día para hacerle compañía.||Le gusta jugar con juguetes que chirrían, pero puede perder el interés muy rápidamente y prefiere estar en compañía de sus amigos humanos.||Es un perro sociable y le gusta conocer a otros perros. Debido a su tamaño, sus nuevos dueños deberán ser físicamente fuertes, ya que Murphy es un perro que saluda con entusiasmo.||Puede hacer buenas migas con otros perros cuando sale a pasear y tiene el potencial de vivir con un compañero que sea adecuado para él.||La casa ideal de Murphy tendría una entrada en la planta baja y un jardín donde pudiera relajarse mientras hace sol. Necesitará nuevos dueños que estén cerca durante el día y que puedan aumentar poco a poco el tiempo que se queda solo, y podría vivir con niños mayores que puedan leer su lenguaje corporal y darle espacio cuando lo necesite.||Si tiene espacio para una cama cómoda lo suficientemente grande para Murphy, solicite su alquiler hoy mismo.||“Debido a su tamaño, Murphy necesitará que alguien físicamente capaz de manejarla la saque a pasear. Las razas de bulldog grandes no suelen ser adecuadas para dueños primerizos o inexpertos, y siempre recomendamos a quienes estén pensando en adoptar o comprar un bulldog grande que investiguen a fondo los antecedentes del perro de antemano”.', '2014-05-14 00:00:00', 28.00, 50.00, 'male', 'atigrado blanco', '{Curioso,Energético,Juguetón}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733756432/123e4567-e89b-12d3-a456-426614174005/purs4t6hdsxhktjvjnf0.png", "fileName": "Murphy-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174005/purs4t6hdsxhktjvjnf0"}', 1, 8, '123e4567-e89b-12d3-a456-426614174005', 'Available', '2024-12-09 10:03:12.057', '2024-12-09 10:03:12.057');
INSERT INTO public.pets VALUES (5, 'Bailey', 'Bailey puede ser un poco tímida en situaciones nuevas y cuando conoce gente nueva, y necesitará que los nuevos dueños sean pacientes y la apoyen.||Bailey ha mostrado una falta de confianza aquí en el centro cuando se encuentra con perros desconocidos, pero está haciendo un gran progreso en la construcción de amistades con algunos de los perros aquí, y está mostrando un lado un poco juguetón con sus amigos más familiares, debido a la falta de confianza de Bailey y la necesidad de apoyo con su nuevo entorno y caminó en rutas de paseo para perros más tranquilas y necesitaría ser la única mascota en el hogar.||Después de un paseo, nada le gusta más que relajarse en su cama, o a tu lado en el sofá y recibir todos los mimos que se merece.||Bailey busca idealmente un hogar donde haya alguien cerca durante gran parte del día y un hogar con niños adolescentes mayores que puedan permitirle espacio y paciencia cuando sea necesario.||Si tiene un espacio con forma de Labrador en su vida, complete una solicitud hoy', '2019-03-19 00:00:00', 32.00, 51.00, 'female', 'amarillo', '{Juguetona,Inteligente}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733625947/123e4567-e89b-12d3-a456-426614174014/eaosxqyf85chgrwocz7v.png", "fileName": "Bailey-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/eaosxqyf85chgrwocz7v"}', 1, 1, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-07 21:46:01.456', '2024-12-07 21:46:01.456');
INSERT INTO public.pets VALUES (13, 'Eddy', 'Es un pequeño terrier amante de la diversión, al que le encanta estar rodeado de gente.||A Eddy le encanta interactuar jugando con sus juguetes, especialmente con una pelota de tenis.||¡Le encanta el cariño y es un hombrecito tierno que disfruta de un buen rasguño!||A Eddy le gusta mucho salir a caminar y olfatear todo el entorno, tiene mucha energía, por lo que le encantaría tener un dueño al que también le guste caminar.||Eddy se siente cómodo al cruzarse con otros perros durante sus paseos, pero no siempre elige interactuar con ellos y prefiere hacer lo que quiera. Es más adecuado para caminar donde no hay muchos perros sueltos que puedan correr hacia él y asustarlo.||Eddy puede sentirse incómodo con ciertas manipulaciones y no le gusta que lo levanten. También sufre de sobresaltos al dormirse, por lo que no es necesario molestarlo cuando descansa. Eddy es muy evidente en su malestar y no sería adecuado para vivir con niños pequeños que podrían no ser capaces de interpretar su lenguaje corporal.||¡Eddy querría ser la única mascota en la casa para poder disfrutar de todo el amor y la atención!||Le encanta jugar, aprender, caminar y acurrucarse.', '2018-04-25 00:00:00', 18.00, 23.00, 'male', 'Blanco', '{Sociable,Juguetón}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733759503/123e4567-e89b-12d3-a456-426614174013/dnduzwvjnkgy1pstmcqf.png", "fileName": "Eddy-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174013/dnduzwvjnkgy1pstmcqf"}', 1, 12, '123e4567-e89b-12d3-a456-426614174013', 'Available', '2024-12-09 10:52:21.627', '2024-12-09 10:52:21.627');
INSERT INTO public.pets VALUES (14, 'Rocco', 'A este adorable niño le gusta sentarse y mirar por la ventana mientras el mundo pasa. No es muy alborotador, pero prefiere sentarse a tu lado. Es un niño independiente que necesita acceso al exterior en su nuevo hogar y, preferiblemente, en una zona rural, ya que le gusta deambular.||Lo mejor para Rocco sería no vivir con gatos, ya que no le gustan. No podrá vivir con perros, ya que puede ser sensible.||Rocco puede vivir con niños adolescentes mayores. Este dulce niño se adaptaría a un hogar más tranquilo donde pueda pasar el tiempo mirando por la ventana en busca de su próxima aventura.||Si crees que este es tu hogar, no dudes en contactarnos', '2019-08-17 00:00:00', 4.00, 20.00, 'male', 'Atigrado', '{Sociable,Juguetón}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733760089/123e4567-e89b-12d3-a456-426614174014/ccupmanfp29wgogmjjjk.png", "fileName": "Rocco-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/ccupmanfp29wgogmjjjk"}', 2, 22, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 11:01:53.168', '2024-12-09 11:01:53.168');
INSERT INTO public.pets VALUES (17, 'Tommy', 'Tommy es un compañero fiel que es más feliz cuando está rodeado de personas que conoce. Es un amigo confiable al que puedes contarle absolutamente cualquier cosa. Lo mejor de todo es que se sentará en tu rodilla e incluso te dará un cabezazo amistoso en la cara para demostrarte cuánto te ama.||Tommy no es especialmente exigente y su horario es flexible, por lo que puede estar solo para hacer sus cosas, tomar el sol en el jardín o acurrucarse para dormir en el sofá. Sin embargo, una cosa es segura: disfruta de su tiempo al aire libre, por lo que el acceso constante al jardín después de su período de adaptación es imprescindible.||Tommy prefiere la vida tranquila y disfruta de su propio espacio, por lo que un hogar sin niños pequeños sería lo mejor para él. No le gustan los otros gatos y no ha tenido contacto con perros, por lo que preferiría un hogar tranquilo sin otros gatos o perros residentes.||Tommy aún no ha abandonado sus días de gatito y le encantan los juguetes para perseguir y cazar, por lo que contar con muchas opciones para jugar de forma independiente y con compañeros humanos sería perfecto.', '2018-09-17 00:00:00', 4.00, 22.00, 'male', 'Negro', '{Protector,Leal,Juguetón}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733761351/123e4567-e89b-12d3-a456-426614174014/c2ay4ry7yuw6x0hzffot.png", "fileName": "Tommy-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/c2ay4ry7yuw6x0hzffot"}', 2, 22, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 11:22:47.048', '2024-12-09 11:22:47.048');
INSERT INTO public.pets VALUES (18, 'Dorothy', 'Dorothy es una mujer muy relajada y tranquila, que disfruta de una vida más tranquila con mucho espacio para explorar y aventurarse.||Su naturaleza relajada la convierte en la compañera perfecta y de bajo mantenimiento.||Después de su día de aventuras, ella te estará esperando para darte la bienvenida a casa.||Esta adorable niña busca un hogar donde pueda buscar atención y socializar a su antojo. Dorothy se unirá a ti para recibir mimos y atención y disfruta de pasar tiempo relajándose con sus personas favoritas.||Si bien es una gata segura de sí misma, creemos que Dorothy se adaptaría mejor a un hogar con niños mayores que respeten sus límites y le permitan la independencia que necesita.||A Dorothy le encanta pasar sus días vagando por el vecindario y vivir aventuras antes de regresar a casa con su familia.||¿Podrías adoptar a nuestra encantadora Dorothy?', '2012-11-11 00:00:00', 3.90, 20.00, 'female', 'Tricolor', '{Cariñosa,Exploradora,Juguetona}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733761785/123e4567-e89b-12d3-a456-426614174014/binswsgvufv5vskizihz.png", "fileName": "Dorothy-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/binswsgvufv5vskizihz"}', 2, 24, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 11:29:54.747', '2024-12-09 11:29:54.747');
INSERT INTO public.pets VALUES (19, 'Alfie', 'El explorador independiente con debilidad por llamar la atención.||Alfie es un niño encantador y seguro de sí mismo que disfruta de la vida a su manera. Es independiente y pasa la mayor parte del día explorando la zona, pero siempre vuelve a casa para recibir mimos y atención bien merecidos.||A Alfie le encanta que lo rasquen y lo acurruquen cuando está de humor, pero no esperes que se siente en tu regazo por mucho tiempo, ya que preferirá que no lo cargues.||Las caras nuevas pueden poner a Alfie un poco nervioso al principio, pero con paciencia y algunas golosinas sabrosas, se acostumbrará a ti en poco tiempo.||Él no es alguien que necesite afecto constante, pero cuando esté listo para tener compañía, acudirá a ti.||El hogar perfecto para Alfie es aquel en el que puede entrar y salir cuando quiera y disfrutar de la compañía de personas que respetan su espacio.||Si estás buscando un compañero que requiera poco mantenimiento y que sea tan aventurero como cariñoso, ¡Alfie podría ser el perro perfecto para ti!||Por favor adopten a Alfie.', '2016-09-14 00:00:00', 2.80, 15.00, 'male', 'Gris y blanco', '{Explorador,Juguetón}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733763476/123e4567-e89b-12d3-a456-426614174014/czkuatkh87lxswtkwmf7.png", "fileName": "Alfie-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/czkuatkh87lxswtkwmf7"}', 2, 22, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 11:58:21.4', '2024-12-09 11:58:21.4');
INSERT INTO public.pets VALUES (26, 'Bolita', 'Este adorable hámster rescatado tiene una fascinación única por construir intrincados túneles y esconder cuidadosamente sus alimentos en pequeños rincones. Su espíritu curioso lo mantiene entretenido mientras explora su entorno y organiza su espacio con esmero.||A pesar de ser tan activo y creativo, es un compañero extremadamente tranquilo y cariñoso. Su naturaleza apacible lo hace ideal para familias con niños pequeños, ya que disfruta de las caricias suaves y la compañía relajada.||Con su pelaje suave y sus ojitos brillantes, este hámster no solo es hermoso, sino también una fuente constante de ternura. Adoptarlo no solo significa darle un hogar, sino también la oportunidad de compartir momentos únicos y entrañables con un pequeño pero encantador amigo.', '2023-01-15 00:00:00', 0.10, 8.00, 'male', 'Blanco y gris', '{Tranquilo,Curioso}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733767663/123e4567-e89b-12d3-a456-426614174014/shrdrjh0zjw8kl4byx1v.png", "fileName": "Bolita-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/shrdrjh0zjw8kl4byx1v"}', 3, 32, '123e4567-e89b-12d3-a456-426614174013', 'Available', '2024-12-09 13:08:12.769', '2024-12-09 13:08:12.769');
INSERT INTO public.pets VALUES (28, 'Chispa', 'Este simpático hámster rescatado es un experto en crear pequeños refugios y almacenar su comida con gran destreza. Siempre está en movimiento, explorando y buscando el lugar perfecto para esconder sus tesoros, lo que lo convierte en un compañero fascinante de observar.||Aunque es muy activo, su carácter dulce y tranquilo lo hace ideal para hogares con niños pequeños. Disfruta de los momentos de calma y siempre está dispuesto a recibir una caricia, lo que lo convierte en una mascota perfecta para quienes buscan un amigo pequeño pero lleno de ternura.', '2023-03-10 00:00:00', 0.07, 7.00, 'male', 'Amarillo dorado', '{Curioso,Energético}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733769969/123e4567-e89b-12d3-a456-426614174014/qvq7rkucrcuiu4yt6yt9.png", "fileName": "Chispa-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/qvq7rkucrcuiu4yt6yt9"}', 3, 34, '123e4567-e89b-12d3-a456-426614174013', 'Available', '2024-12-09 13:08:12.769', '2024-12-09 13:08:12.769');
INSERT INTO public.pets VALUES (22, 'Xara', 'Conoce a Xara, la encantadora conejita que seguro te encantará con su carácter dulce y cariñoso. Aunque es nueva en nuestro cuidado, Xara ya ha demostrado ser una exploradora curiosa a la que le encanta descubrir nuevos rincones y recovecos, convirtiendo cada día en una aventura.||Una de las primeras cosas que notarás en Xara son sus impresionantes pestañas, que enmarcan sus expresivos ojos de manera hermosa. Le dan una mirada distintiva a la que es simplemente difícil resistirse. Siempre está lista para interactuar con su entorno, mostrando la combinación perfecta de curiosidad y amabilidad.||La naturaleza cariñosa de Xara significa que disfruta estar rodeada de personas y ama a las mascotas gentiles. Es un conejo atento, probablemente te seguirá a todas partes, haciendo de tu hogar su patio de juegos mientras desarrolla un vínculo seguro con su nueva familia.||Ya sea saltando por tu jardín o explorando un espacio interior acogedor, Xara se adapta con entusiasmo y alegría. Busca un hogar donde pueda satisfacer su curiosidad y disfrutar de una compañía amorosa.||Si buscas un conejo adorable y cariñoso con un don para la exploración, Xara sería una encantadora incorporación a tu hogar. Ven a conocerla hoy y observa esas hermosas pestañas en persona. ¡Son solo el comienzo de sus muchos encantos!', '2023-12-09 00:00:00', 2.60, 25.00, 'female', 'Blanco', '{Cariñosa,Exploradora,Tranquila}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733765504/123e4567-e89b-12d3-a456-426614174014/gsp4dfgot9txazpsuwov.png", "fileName": "Xara-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/gsp4dfgot9txazpsuwov"}', 4, 38, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 12:33:40.643', '2024-12-09 12:33:40.643');
INSERT INTO public.pets VALUES (23, 'Yasmina', 'Conozca a Yasmina, una conejita curiosa y cautivadora que acaba de comenzar su nueva etapa con nosotros. Aunque todavía estamos en el maravilloso proceso de conocerla, Yasmina ya ha mostrado signos de una naturaleza encantadora e inquisitiva. Sus ojos brillantes y su hermoso pelaje la convierten en una compañera cautivadora.||A medida que Yasmina se adapta a su nuevo entorno, estamos ansiosos por descubrir más sobre su personalidad y sus intereses únicos. Parece estar abierta a establecer conexiones y estamos seguros de que pronto revelará su verdadero yo. Ya sea poniéndose cómoda en un rincón lleno de heno o explorando cada rincón de su espacio, Yasmina es una conejita con potencial para convertirse en un miembro querido de cualquier familia.||¡Sigue atento a medida que seguimos aprendiendo más sobre Yasmina y lo que hace que su corazón salte de alegría! Si estás buscando un conejo prometedor y quieres unirte a este viaje de descubrimiento, Yasmina podría ser la incorporación perfecta a tu hogar.', '2024-01-19 00:00:00', 1.50, 17.00, 'female', 'Platinado', '{Amigable,Activa}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733765986/123e4567-e89b-12d3-a456-426614174014/xwelrvgbovfhe0jebz9f.png", "fileName": "Yasmine-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/xwelrvgbovfhe0jebz9f"}', 4, 37, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 12:39:57.67', '2024-12-09 12:39:57.67');
INSERT INTO public.pets VALUES (24, 'Cookie', 'Conoce a Cookie, un chico irresistiblemente encantador y de naturaleza dulce al que le encantaría ser parte de un hogar acogedor y libre. Se desarrolla bien en entornos espaciosos donde puede explorar a su antojo. Los espacios pequeños pueden estresarlo, por lo que un entorno abierto y acogedor lo convertiría en el conejito más feliz del mundo. La curiosidad de Ultimate Cookie solo es comparable con su naturaleza afectuosa; es un pequeño explorador divertido que disfruta de hacer rondas para ver cómo estás.||Cookie adora sus túneles y escondites, y los recorre con una exuberancia juguetona. Su amor por la variedad se extiende a su dieta: no se cansa de una amplia variedad de verduras. Una vez que se familiarice contigo, comenzará a demostrarte su afecto dándote los besos más dulces. Cuando llegues a casa, espera que este adorable gatito corra hacia ti, buscando ansiosamente caricias y abrazos. Su naturaleza amistosa también ha demostrado que está interesado en tener una conejita de compañía, por lo que una posible conejita sería una gran ventaja.||Dado que Cookie ha tenido una cirugía del conducto auditivo y trabajos dentales en el pasado, los controles regulares son esenciales para mantenerlo saludable y feliz. Como es una raza de orejas caídas, necesita que un veterinario experto en conejos controle sus orejas y dientes para asegurarse de que todo se mantenga en óptimas condiciones.Si buscas un conejo juguetón, cariñoso y encantador que llene tu hogar de alegría y risas,Cookie es la opción perfecta. ¡Está listo para saltar a tu vida y a tu corazón, trayendo consigo un amor infinito y travesuras encantadoras!', '2020-08-13 00:00:00', 6.00, 25.00, 'male', 'Cafe', '{Juguetón,Cariñoso,Encantador}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733766460/123e4567-e89b-12d3-a456-426614174014/kkfporndvucfywswkbay.png", "fileName": "Cookie-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/kkfporndvucfywswkbay"}', 4, 36, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 12:47:53.141', '2024-12-09 12:47:53.141');
INSERT INTO public.pets VALUES (25, 'Quinn', '¡Damos la bienvenida a Quinn, un conejo manso que ama el heno y la vegetación! Con un carácter relajado y sumiso, Quinn es un excelente compañero que está ansioso por aprender y hacer amigos con otros conejos. Es una verdadera joya y se adapta a la atención humana como un ser natural.||Quinn es un conejito sociable y cálido que disfruta de anidar en una cama acogedora y masticar su amado heno de avena. Es un bulto peludo de puro amor y comodidad. Quinn no es exigente en lo que respecta a la comida, y muestra el mismo entusiasmo por sus complementos de heno, ensaladas verdes y bolitas de forraje. Su alegría a la hora de comer es bastante evidente, ya que salta de un lado a otro con anticipación.||Una vez que se siente cómodo en tus brazos, este hermoso muchacho disfruta de un largo abrazo y no duda en demostrar su afecto. Es una vista reconfortante cuando se siente seguro y cómodo, y brinda alegría a quien lo sostiene.||Todavía estamos conociendo a Quinn, pero muestra todas las señales de que se integrará bien en un hogar con otros conejos. Si estás buscando un conejo amigable, tranquilo y cariñoso que prometa una compañía encantadora, ¡Quinn podría ser tu pareja! Llévalo a casa y experimenta la alegría del amor de un conejo', '2023-12-14 00:00:00', 2.80, 23.00, 'male', 'Cafe y Blanco', '{Amigable,Cariñoso,Encantador}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733766913/123e4567-e89b-12d3-a456-426614174014/wcxfyeppiafqabh9x0zc.png", "fileName": "Quinn-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/wcxfyeppiafqabh9x0zc"}', 4, 38, '123e4567-e89b-12d3-a456-426614174014', 'Available', '2024-12-09 12:55:29.648', '2024-12-09 12:55:29.648');
INSERT INTO public.pets VALUES (27, 'Nube', 'Este encantador hámster rescatado es un verdadero amante de la aventura, siempre ocupado construyendo túneles y buscando el lugar perfecto para esconder sus alimentos. Su energía y curiosidad lo convierten en un compañero entretenido, siempre listo para explorar su pequeño mundo.||A pesar de su espíritu activo, es sorprendentemente tranquilo y afectuoso. Le encanta la compañía humana y disfruta de los momentos de relajación, convirtiéndose en una excelente opción para familias con niños pequeños que buscan un amigo tierno y divertido.', '2022-07-12 00:00:00', 0.08, 6.50, 'male', 'Blanco', '{Activo,Juguetón}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733769970/123e4567-e89b-12d3-a456-426614174014/gwmiqvbdwd14edixvnca.png", "fileName": "Nube-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/gwmiqvbdwd14edixvnca"}', 3, 33, '123e4567-e89b-12d3-a456-426614174013', 'Available', '2024-12-09 13:08:12.769', '2024-12-09 13:08:12.769');
INSERT INTO public.pets VALUES (29, 'Pelusa', 'Esta encantadora hámster rescatada es una experta en crear intrincados túneles y esconder sus pequeños tesoros con gran destreza. Su naturaleza curiosa la mantiene siempre en movimiento, explorando cada rincón de su hogar y buscando nuevos lugares para sus reservas de comida.||A pesar de su energía, es una compañera tranquila y afectuosa, ideal para hogares con niños pequeños. Le encanta pasar tiempo en compañía de su familia, disfrutando de caricias suaves y momentos de calma, lo que la convierte en una mascota perfecta para quienes buscan ternura y diversión en un pequeño paquete.', '2023-05-22 00:00:00', 0.09, 7.80, 'female', 'Marrón claro', '{Cariñoso,Relajado}', '{"url": "https://res.cloudinary.com/dyntsz5qv/image/upload/v1733770113/123e4567-e89b-12d3-a456-426614174014/y1qvjpszfmyhtlv960ds.png", "fileName": "Pelusa-profile.PNG", "publicId": "123e4567-e89b-12d3-a456-426614174014/y1qvjpszfmyhtlv960ds"}', 3, 35, '123e4567-e89b-12d3-a456-426614174013', 'Available', '2024-12-09 13:08:12.769', '2024-12-09 13:08:12.769');
